    false,nt"url": null,nt"notes": "These digital maps contain information
    on the altitude of the base and top, the extent, and the potentiometric surface
    of the Ozark aquifer in Kansas. The Ozark aquifer consists of weathered and sandy
    dolomite and limestone of Ordovician and Cambrian age and includes the Arbuckle
    Group. The digital map was developed from 1:500,000- and 1:1,000,000-scale source
    information. The altitude for the base and top contour interval is 100 feet. The
    potentiometric surface contour interval is 50 feet.",nt"license_title": null,nt"extras":
